:"5878","type":"AllLabels"},{"attributes":{"days":[1,4,7,10,13,16,19,22,25,28]},"id":"5952","type":"DaysTicker"},{"attributes":{"coordinates":null,"group":null,"text":"Number of File Descriptors"},"id":"5791","type":"Title"},{"attributes":{"child":{"id":"5425"},"title":"Worker Profile (compute)"},"id":"5825","type":"Panel"},{"attributes":{},"id":"5581","type":"CategoricalScale"},{"attributes":{"dimensions":"width"},"id":"5809","type":"PanTool"},{"attributes":{"tools":[{"id":"5559"},{"id":"5561"},{"id":"5562"},{"id":"5563"},{"id":"5564"},{"id":"5565"}]},"id":"5552","type":"Toolbar"},{"attributes":{"style":{"border":"1px solid lightgray","box-shadow":"inset 1px 0 8px 0 lightgray","height":"100%","max-height":"1080px","max-width":"1920px","overflow":"auto","padding":"12px","width":"100%"},"text":"\n        &lt;h1&gt; Dask Performance Report &lt;/h1&gt;\n\n        &lt;i&gt; Select different tabs on the top for additional information &lt;/i&gt;\n\n        &lt;h2&gt; Duration: 35.45 s &lt;/h2&gt;\n        &lt;h2&gt; Tasks Information &lt;/h2&gt;\n        &lt;ul&gt;\n         &lt;li&gt; number of tasks: 511 &lt;/li&gt;\n         \n&lt;li&gt; compute time: 4236.34 s &lt;/li&gt;\n&lt;li&gt; transfer time: 52.13 s &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Scheduler Information &lt;/h2&gt;\n        &lt;ul&gt;\n          &lt;li&gt; Address: tcp://10.32.2.33:40433 &lt;/li&gt;\n          &lt;li&gt; Workers: 128 &lt;/li&gt;\n          &lt;li&gt; Threads: 128 &lt;/li&gt;\n          &lt;li&gt; Memory: 1.86 TiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2021.09.1 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 2021.09.1 &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\n\nfrom dask_jobqueue import SLURMCluster\nfrom distributed import Client\n\nfrom dask.distributed import performance_report, get_task_stream\n\n#import logging\n#logging.basicConfig(format='%(levelname)s:%(message)s', level=logging.DEBUG)\n\ncores = 32\nnodes = 4\n\ncluster = SLURMCluster(memory          = '{}g'.format(16*cores),\n                       processes       = cores,\n                       name            = 'testdask-${JOB_ID}',\n                       cores           = cores,\n                       queue           = 'photon',\n                       local_directory = '/tmp',\n                       death_timeout   = '100000000000s',\n                       walltime        = '01:00:00',\n                       header_skip     = ['-n 1'], \n                       env_extra       = ['JOB_ID=${SLURM_ARRAY_JOB_ID}_${SLURM_ARRAY_TASK_ID}'],\n                       job_extra       = ['--ntasks-per-node=1', '--array=0-{}'.format(nodes-1), '--exclusive']) \n\ncluster.scale(jobs=1)\nclient = Client(cluster)\n\nclient.get_versions(check=True)\n\n\n#import pdb; pdb.set_trace() \n#client.upload_file('../../root/root_rdfenv-ucx-2/lib/DistRDF/Backends/Dask/Backend.py')\n\nimport ROOT\nROOT.gROOT.SetBatch(True)\nRDataFrame = ROOT.RDF.Experimental.Distributed.Dask.RDataFrame\n\n\n\ndef dimuonSpectrum(df):\n\n    # Select events with exactly two muons\n    df_2mu = df.Filter(\"nMuon == 2\", \"Events with exactly two muons\")\n\n    # Select events with two muons of opposite charge\n    df_os = df_2mu.Filter(\"Muon_charge[0] != Muon_charge[1]\", \"Muons with opposite charge\")\n\n    # Compute invariant mass of the dimuon system\n    df_mass = df_os.Define(\"Dimuon_mass\", \"ROOT::VecOps::InvariantMass(Muon_pt, Muon_eta, Muon_phi, Muon_mass)\")\n\n    # Book histogram of dimuon mass spectrum\n    bins = 30000  # Number of bins in the histogram\n    low = 0.25  # Lower edge of the histogram\n    up = 300.0  # Upper edge of the histogram\n    hist = df_mass.Histo1D(ROOT.RDF.TH1DModel(\"\", \"\", bins, low, up), \"Dimuon_mass\")\n\n    hist.GetValue() # triggers the event loop\n\n\nif __name__ == '__main__':\n    \n    filelist = [\"input_files/dimuon/f{}.root\".format(i) for i in range(1, 101)]\n    df = RDataFrame(\"Events\", filelist, npartitions=256, daskclient=client) \n   \n    #import pdb; pdb.set_trace()\n   \n    for r in range(3):\n        client.wait_for_workers(cores*nodes)\n        with performance_report(filename=\"dask-report_{}.html\".format(r)):\n            dimuonSpectrum(df)\n    client.close()\n\n        &lt;/pre&gt;\n        "},"id":"5823","type":"Div"},{"attributes":{"range_padding":0},"id":"5534","type":"DataRange1d"},{"attributes":{"dimensions":"width"},"id":"5564","type":"PanTool"},{"attributes":{"source":{"id":"5635"}},"id":"5820","type":"CDSView"},{"attributes":{"num_minor_ticks":5,"tickers":[{"id":"5882"},{"id":"5883"},{"id":"5884"},{"id":"5885"},{"id":"5886"},{"id":"5887"},{"id":"5888"},{"id":"5889"},{"id":"5890"},{"id":"5891"},{"id":"5892"},{"id":"5893"}]},"id":"5545","type":"DatetimeTicker"},{"attributes":{"coordinates":null,"formatter":{"id":"5863"},"group":null,"major_label_policy":{"id":"5864"},"ticker":{"id":"5475"},"visible":false},"id":"5474","type":"LinearAxis"},{"attributes":{"data":{"bandwidth":[1,2],"bandwidth_text":["1","2"],"destination":["a","b"],"source":["a","b"]},"selected":{"id":"5929"},"selection_policy":{"id":"5928"}},"id":"5572","type":"ColumnDataSource"},{"attributes":{"line_color":"#1f77b4","x":{"field":"time"},"y":{"field":"memory"}},"id":"5697","type":"Line"},{"attributes":{},"id":"5620","type":"CategoricalTicker"},{"attributes":{"dimensions":"width"},"id":"5723","type":"PanTool"},{"attributes":{"start":0},"id":"5642","type":"DataRange1d"},{"attributes":{"line_alpha":0.1,"line_color":"#1f77b4","x":{"field":"time"},"y":{"field":"memory"}},"id":"5698","type":"Line"},{"attributes":{},"id":"5930","type":"UnionRenderers"},{"attributes":{"below":[{"id":"5544"}],"center":[{"id":"5547"},{"id":"5551"}],"min_border_bottom":50,"name":"task_stream","renderers":[{"id":"5557"}],"sizing_mode":"stretch_both","title":{"id":"5536"},"toolbar":{"id":"5552"},"toolbar_location":"above","x_range":{"id":"5533"},"x_scale":{"id":"5540"},"y
